import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';

@Component({
  selector: 'app-add-object',
  templateUrl: './add-object.component.html',
  styleUrls: ['./add-object.component.css']
})
export class AddObjectComponent implements OnInit {
  // change to person stats
  firstName: string = '';
  lastName: string = '';
  gamertag: string = '';
  platform: string = '';
  age: number = 0;
  region: string = '';

  constructor(
    private router: Router,
  ) { }

  ngOnInit(): void {
  }

  onSubmit(): void {
    alert('Creating new object...');
    this.router.navigateByUrl('/query');
  }
}
<div class="content-box">
    <h2>Create New Listing</h2>
    <form (ngSubmit)="onSubmit()">
        <div>
            <label for="firstName">
                First Name:
            </label>
            <input id="firstName" name="firstName" type="text" (ngModel)="firstName" />
        </div>
        <div>
            <label for="lastName">
                Last Name:
            </label>
            <input id="lastName" name="lastName" type="text" (ngModel)="lastName" />
        </div>
        <div>
            <label for="gamertag">
                Gamertag:
            </label>
            <input id="gamertag" name="gamertag" type="text" (ngModel)="gamertag" />
        </div>
        <div>
            <label for="platform">
                Platform:
            </label>
            <input id="platform" name="platform" type="text" (ngModel)="platform" />
        </div>
        <div>
            <label for="age">
                Age:
            </label>
            <input id="age" name="age" type="number" (ngModel)="age" />
        </div>
        <div>
            <label for="region">
                Region:
            </label>
            <input id="region" name="region" type="text" (ngModel)="region" />
            <select id="cars" name="cars">
                <option value="volvo">Volvo</option>
                <option value="saab">Saab</option>
                <option value="fiat">Fiat</option>
                <option value="audi">Audi</option>
              </select>
        </div>
        <button (click)="onSubmit()">Create Listing</button>
    </form>
</div>
